// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

contract Panda {

    uint public game;
    uint public round;
    uint public topDeposit;
    uint public pool;
    uint public stake;
    uint public minValue = 0.001 ether; // DOUBLE_CHECK
    uint public newRoundBouns;

    address payable public topDepositor;
    address public lastWinner;
    address public contractOwner;

    mapping(address => uint) public balances;

    event DepositMade (uint game, uint round, address originator, uint value, uint stake);

    constructor() {
        contractOwner = msg.sender;
    }

    modifier contractOwnerOnly() {
        require(msg.sender == contractOwner);
        _;
    }

    modifier minTransactionValue() {
        require(msg.value >= minValue);
        _;
    }

    function deposit() minTransactionValue public payable {
        round++;
        pool += msg.value;
        stake = pool * 97 / 100 + newRoundBouns; // OKOK
        balances[msg.sender] = msg.value;
        emit DepositMade(game, round, msg.sender, balances[msg.sender], stake);
        isTopDepositor();
        isPayday();
    }

    function isTopDepositor() private {
        if (msg.value > topDeposit) {
            topDepositor = payable(msg.sender);
            topDeposit = msg.value;
            if (topDeposit > minValue * 2 ) {
                minValue = topDeposit / 2;
            }
        }
    }

    function isPayday() private {
        if (round >= 5) {
            topDepositor.transfer(stake);
            newGame();
        }
    }

    function newGame() private {
        pool = 0;
        newRoundBouns = stake / 100;
        stake = newRoundBouns;
        round = 0;
        topDeposit = 0;
        lastWinner = topDepositor;
        topDepositor = payable(address(0));
        minValue = 0.001 ether;
        game++;       
    }

    // TESTY

    function whatGame() public view returns (uint) {
        return game;     
    }

    function whatRound() public view returns (uint) {
        return round;     
    }

    function whatMinValue() public view returns (uint) {
        return minValue;     
    }

    function whatStake() public view returns (uint) {
        return stake;     
    }

    function whoTopDepositor() public view returns (address) {
        return topDepositor;     
    }

    function whatTopDeposit() public view returns (uint) {
        return topDeposit;     
    }

    function whoLastWinner() public view returns (address) {
        return lastWinner;     
    }

}

